import React from "react";


function App(){

    let cdate = new Date(2020,8,24,13);
    cdate = cdate.getHours();
     let greet="";

    if(cdate>=1 && cdate<12){
     greet ="good morning";
    }else if(cdate >= 12 && cdate < 19){
        greet="good evening";
    }else{
        greet="good night";
    }
     
    return (
    <>
    <div>
       
       <h1>hey sir {greet}</h1>;
       </div>

      </> )
       }

export default App;
